UPDATE Company
   SET comp_PRConnectionListDate = NULL
WHERE comp_CompanyID IN (
	SELECT comp_CompanyID
	  FROM Company 
		   LEFT OUTER JOIN PRCompanyRelationship ON comp_CompanyID = prcr_LeftCompanyID
												AND prcr_Active = 'Y'
												AND prcr_Type IN ('09', '10', '11', '12', '13', '14', '15', '16')
	WHERE comp_PRConnectionListDate IS NOT NULL
	 -- AND comp_PRListingStatus IN ('L', 'LUV', 'H')
	GROUP BY comp_CompanyID, comp_PRConnectionListDate, comp_PRListingStatus
	HAVING COUNT(DISTINCT prcr_RightCompanyID)  = 0)
Go


UPDATE PRCompanySearch
   SET prcse_NameMatch = dbo.GetLowerAlpha(dbo.ufn_PrepareCompanyName(comp_Name)),
       prcse_LegalNameMatch = CASE WHEN comp_PRLegalName IS NOT NULL THEN dbo.GetLowerAlpha(dbo.ufn_PrepareCompanyName(comp_PRLegalName)) ELSE NULL END,
	   prcse_OriginalNameMatch = CASE WHEN comp_PROriginalName IS NOT NULL THEN dbo.GetLowerAlpha(dbo.ufn_PrepareCompanyName(comp_PROriginalName)) ELSE NULL END,
	   prcse_OldName1Match = CASE WHEN comp_PROldName1 IS NOT NULL THEN dbo.GetLowerAlpha(dbo.ufn_PrepareCompanyName(comp_PROldName1)) ELSE NULL END,
	   prcse_OldName2Match = CASE WHEN comp_PROldName2 IS NOT NULL THEN dbo.GetLowerAlpha(dbo.ufn_PrepareCompanyName(comp_PROldName2)) ELSE NULL END,
	   prcse_OldName3Match = CASE WHEN comp_PROldName3 IS NOT NULL THEN dbo.GetLowerAlpha(dbo.ufn_PrepareCompanyName(comp_PROldName3)) ELSE NULL END,
	   prcse_CorrTradestyleMatch = dbo.GetLowerAlpha(dbo.ufn_PrepareCompanyName(comp_PRCorrTradestyle))
  FROM Company 
 WHERE prcse_CompanyId = comp_companyid;
Go


DELETE FROM CRM.dbo.PRInvoiceTaxRate;
SELECT hdr.UDF_MASTER_INVOICE,
       hdr.InvoiceNo,
	   det.TaxClass,
	   item.Category2,
	   prod.ProductLineDesc,
	   SUM(ExtensionAmt) as InvoiceAmt,
	   mtax.TaxRate,
	   SUM(ExtensionAmt) * (mtax.TaxRate/100) as TaxAmt,
	   tax.prtax_County,
	   tax.prtax_City,
	   tax.prtax_State
  FROM MAS_PRC.dbo.AR_InvoiceHistoryDetail det WITH (NOLOCK)
       INNER JOIN MAS_PRC.dbo.CI_Item Item WITH (NOLOCK) ON item.ItemCode = det.ItemCode
       INNER JOIN MAS_PRC.dbo.AR_InvoiceHistoryHeader hdr WITH (NOLOCK) ON hdr.InvoiceNo = det.InvoiceNo
																		AND ((det.ItemType = '5' AND hdr.ModuleCode = 'A/R') OR (det.ItemType = '1' AND hdr.ModuleCode = 'S/O'))
																		AND hdr.HeaderSeqNo = det.HeaderSeqNo
	   INNER JOIN crm.dbo.PRTaxRate tax WITH (NOLOCK) ON tax.prtax_TaxCode = hdr.TaxSchedule
       INNER JOIN MAS_SYSTEM.dbo.SY_SalesTaxCodeDetail mtax WITH (NOLOCK) ON mtax.TaxCode = hdr.TaxSchedule
																		AND mtax.TaxClass = det.TaxClass
       INNER JOIN MAS_PRC.dbo.IM_ProductLine prod WITH (NOLOCK) ON prod.ProductLine = item.ProductLine
 WHERE hdr.InvoiceDate >= '2014-02-26'  -- The last date we imported tax rates
   AND hdr.UDF_MASTER_INVOICE <> ''
GROUP BY  hdr.UDF_MASTER_INVOICE,
          hdr.InvoiceNo,
  		  det.TaxClass,
		  item.Category2,
		  prod.ProductLineDesc,
		  mtax.TaxRate,
		  tax.prtax_County,
		  tax.prtax_City,
		  tax.prtax_State;
Go


